import React from 'react';

class ClassifierForm extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            gender: '',
            gpa: '',
            priority: '',
            points: '',
            direction: ''
        };

        this.handleChange = this.handleChange.bind(this);
        this.handleSubmit = this.handleSubmit.bind(this);
    }

    handleChange(event) {
        const target = event.target;
        const value = target.type === 'checkbox' ? target.checked : target.value;
        const name = target.name;

        this.setState({
            [name]: value
        });
    }

    async handleSubmit(event) {
        event.preventDefault();

        const { gender, gpa, priority, points, direction } = this.state;

        try {
            const response = await fetch('/api/classifier', {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json'
                },
                body: JSON.stringify({ gender, gpa, priority, points, direction })
            });

            const result = await response.json();
            alert(`Результат классификации: ${JSON.stringify(result)}`);
        } catch (error) {
            console.error('Ошибка:', error);
            alert('Произошла ошибка при отправке данных.');
        }
    }

    render() {
        return (
            
            <form onSubmit={this.handleSubmit}>
                {/* Пол */}
                <div>
                    <label>
                        Мужской
                        <input
                            type="radio"
                            name="gender"
                            value="М"
                            checked={this.state.gender === 'М'}
                            onChange={this.handleChange}
                        />
                    </label>
                    <label>
                        Женский
                        <input
                            type="radio"
                            name="gender"
                            value="Ж"
                            checked={this.state.gender === 'Ж'}
                            onChange={this.handleChange}
                        />
                    </label>
                </div>

                {/* Средний балл (GPA) */}
                <div>
                    <label>
                        Средний балл (GPA):
                        <input
                            type="number"
                            name="gpa"
                            value={this.state.gpa}
                            min="0"
                            max="4"
                            step="0.01"
                            onChange={this.handleChange}
                        />
                    </label>
                </div>

                {/* Приоритет */}
                <div>
                    <label>
                        Приоритет:
                        <input
                            type="number"
                            name="priority"
                            value={this.state.priority}
                            min="1"
                            max="5"
                            step="1"
                            onChange={this.handleChange}
                        />
                    </label>
                </div>

                {/* Баллы */}
                <div>
                    <label>
                        Баллы:
                        <input
                            type="number"
                            name="points"
                            value={this.state.points}
                            min="0"
                            max="400"
                            step="1"
                            onChange={this.handleChange}
                        />
                    </label>
                </div>

                {/* Направление */}
                <div>
                    <label>
                        Направление:
                        <select
                            name="direction"
                            value={this.state.direction}
                            onChange={this.handleChange}
                        >
                            <option value="">Выберите направление</option>
                            <option value="информатика">Информатика</option>
                            <option value="математика">Математика</option>
                            <option value="экономика">Экономика</option>
                        </select>
                    </label>
                </div>

                <button type="submit">Отправить</button>
            </form>
        );
    }
}

export default ClassifierForm;
